import s from './nav-bar.module.css'

const Navbar = () => {
    return (
        <nav className={s.nav}>
            <div>
                <a href={'/profile'}>Profile</a>
            </div>
            <div>
                <a href={'/messages'}>Messages</a>
            </div>
            <div>
                <a>News</a>
            </div>
            <div>
                <a>Music</a>
            </div>
            <div>
                <a>Settings</a>
            </div>

        </nav>
    );
};

export default Navbar;
